// Product16.js

import React from 'react';
import Header from './Header';
import './Product16.css'; // Adjust this as per your actual CSS file name and location

function Product16({ navigateTo }) {
  return (
    <div className="product-detail">
      <Header navigateTo={navigateTo} />

      <div className="product-detail-content">
        <div className="product-detail-left">
          <img src="/product16.png" alt="Earthling Shampoo - Simple Fresh" className="product-detail-image" />
        </div>
        <div className="product-detail-right">
          <h2>Earthling Shampoo - Simple Fresh</h2>
          <p className="product-price">$29.99</p>
          <p className="product-reviews">Reviews: 4.7/5</p>
          <p className="product-description">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam sagittis, dolor sed pulvinar feugiat, neque
            purus eleifend nisi, at dignissim velit lectus quis diam. Ut malesuada, justo nec convallis auctor, ligula
            sem tincidunt nisi, sed commodo odio urna eget odio.
          </p>
          <button className="add-to-cart-btn">ADD TO CART</button>
        </div>
      </div>
    </div>
  );
}

export default Product16;
